import React, { useState } from "react";
import watch1 from "../assets/watch1.png";
import watch2 from "../assets/watch2.png";
import watch3 from "../assets/watch3.png";
import watch4 from "../assets/watch4.png";
import watch5 from "../assets/watch5.png";
import watch6 from "../assets/watch6.png";
import watch7 from "../assets/watch7.png";
import watch8 from "../assets/watch8.png";

const Products = () => {
  const [items, setItems] = useState([
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 112,
      imageUrl: watch1,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 100,
      imageUrl: watch2,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 50,
      imageUrl: watch3,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 30,
      imageUrl: watch4,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 75,
      imageUrl: watch5,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 88,
      imageUrl: watch6,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 64,
      imageUrl: watch7,
    },
    {
      name: "GOLDEN HOUR Women's Watch",
      quantity: 40,
      imageUrl: watch8,
    },
  ]);

  return (
    <div className="min-h-screen p-8 bg-gray-100">
      <h1 className="text-3xl font-bold text-gray-800 text-center">
        Our Products
      </h1>
      <div className="grid gap-6 mt-6 grid-cols-1 sm:grid-cols-2 lg:grid-cols-4">
        {items.map((item, index) => (
          <div
            key={index}
            className="bg-white rounded-xl shadow-lg p-4 flex flex-col items-center"
          >
            <img
              src={item.imageUrl}
              alt={item.name}
              className="w-40 h-40 object-cover rounded-lg"
            />
            <h2 className="text-lg font-semibold mt-2">{item.name}</h2>
            <p className="text-gray-600">Quantity: {item.quantity}</p>
            <div className="mt-3 flex space-x-2">
              <button
                title="Edit"
                className="bg-blue-500 hover:bg-blue-600 text-white rounded-full p-2 text-xs flex items-center justify-center"
              >
                ‚úèÔ∏è
              </button>
              <button
                title="Delete"
                className="bg-red-500 hover:bg-red-600 text-white rounded-full p-2 text-xs flex items-center justify-center"
              >
                üóëÔ∏è
              </button>
              <button
                title="Add to Cart"
                className="bg-green-500 hover:bg-green-600 text-white rounded-full p-2 text-xs flex items-center justify-center"
              >
                ‚ûï
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
